import React from 'react';
import ReactDOM from 'react-dom';
import Card from './Cards';
import './index.css';
import Sdata from './Sdata';

ReactDOM.render(
    <div>
    <h1 class="heading_style">List of Netflix Series 2021</h1>
    {Sdata.map((val) => {
        return(
            <Card 
                sname = {val.sname}
                imgsrc = {val.imgsrc}
                title =  {val.title}
                link = {val.link}
            />
        );
    })} 
    </div>,
    document.getElementById("root")
);
